import Link from 'next/link';

function Submitted(props) {

  setTimeout(function(){ Router.push('/submitted'); }, 2000);

  return (
    <div className="submitted">
      Your post was submitted.
      <br /><br />
     <Link><a> Go back to the feed.</a></Link>
    </div>
  );
}

export default Submitted;
